the adverse news are not aml related. reasons for sc investor alert are due to the following:

persons carrying on or hold himself out as carrying on the following regulated activities without a licence from the sc:
• dealing in securities; 
• dealing in derivatives; 
• fund management; 
• advising on corporate finance; 
• investment advice; 
• financial planning; and 
• dealing in private retirement schemes
• persons operating a recognised market without authorisation.
• persons issuing or offering securities without approval, authorisation or recognition.
• persons misusing sc’s logo and misrepresenting the sc.”

source: csc trinity discounting comm 7: treatment for the internal watchlist (info source sc1/source code 53)

